import { PeopleListsState } from "./ListsSlice";

const API_URL = "http://localhost:3000";

export async function fetchPeopleLists() {
    return fetch(`${API_URL}/people`, {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
        },
    }).then((res) => res.json())
    .catch((error) => {
        console.log("Error: ", error);
        return {} as PeopleListsState;
    });
}

export async function fetchCarLists() {
    return fetch(`${API_URL}/cars.json`, {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
        },
    }).then((res) => res.json())
    .catch((error) => {
        console.log("Error: ", error);
        return {} as PeopleListsState;
    });
}
